import React from 'react'
import { Link } from 'react-router-dom'

export const Header = () => {
    return (
        <header>
            <nav>
                <Link to="/">Accueil</Link>
                <Link to="/galerie">Galerie</Link>

            </nav>
        </header>
    )
}
